INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 10.85, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 7, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", 24, 1, 0.0, 100, 100);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 11.15, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 2, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", 24, 1, 0.0, 101, 101);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 6.4, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 5, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", 24, 7, 0.0, 102, 102);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 0.0, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 3, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", 24, 3, 0.0, 103, 103);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 2.43, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 8, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", 24, 2, 0.0, 104, 104);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 9.08, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 3, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", 24, 4, 0.0, 105, 105);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 0.0, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 6, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", 24, 6, 0.0, 106, 106);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 10.6, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 8, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", 24, 3, 0.0, 107, 107);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 7.54, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 4, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", 24, 6, 0.0, 108, 108);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 11.5, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 7, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", 24, 2, 0.0, 109, 109);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 8.83, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 1, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", 24, 2, 0.0, 110, 110);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 6.68, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 2, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", 24, 1, 0.0, 111, 111);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 8.8, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 2, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", 24, 6, 0.0, 112, 112);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 8.9, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 1, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", 24, 2, 0.0, 113, 113);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "エリコ", 3.7, "2024/03/31 12:00:00", 129901, "2030/12/17 14:59:59", 0.0, 5, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", 24, 2, 0.0, 114, 114);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 7.6, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 2, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", 24, 1, 0.0, 200, 200);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 2.25, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", 24, 2, 0.0, 201, 201);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 3.28, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", 24, 2, 0.0, 202, 202);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 2.98, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", 24, 4, 0.0, 203, 203);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 3.0, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", 24, 4, 0.0, 204, 204);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 10.3, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 2, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", 24, 1, 0.0, 205, 205);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 2.93, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", 24, 6, 0.0, 206, 206);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 9.3, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", 24, 3, 0.0, 207, 207);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 6.9, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", 24, 4, 0.0, 208, 208);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 0.0, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 2, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", 24, 2, 0.0, 209, 209);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 5.95, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 2, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", 24, 1, 0.0, 210, 210);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 6.73, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", 24, 2, 0.0, 211, 211);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 0.0, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 2, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", 24, 2, 0.0, 212, 212);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 6.65, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 2, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", 24, 1, 0.0, 213, 213);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (10142, "マコト", 3.05, "2024/03/31 12:00:00", 129801, "2030/12/17 14:59:59", 0.0, 1, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", 24, 6, 0.0, 214, 214);
